import React, {Component} from "react";
import './MiddleContainer.css';
import img from './middle_my_pic3.jpg';

class MiddleContainer extends Component {
    render() {
        return(
            <div className="middle-contain">
                <img src={img} alt="my_pic" className="my_pic3"/>
                <p>Hi, I'm <b>Sahil</b></p>
                <div>
                <h1>Let us take you into a deeper experience, make a moment a lasting conveyable memory. Let us help build your tribe</h1></div>
            </div>
        );
    }
}

export default MiddleContainer;
